import React from 'react'
import {HomeAdmin} from "../../pages/Admin/HomeAdmin";
export function AdminLayout(props) {
    const { children } = props;
    const auth = "agustin"; /* Usuario inicializado en que no esta logeado*/
    if(!auth) return <HomeAdmin/>;/* Si el usuario no esta logeado, retornara el login admin*/
    return (
        <div>
            <p>AdminLayout</p>
            {children}

        </div>
    )
}
